import React from 'react'
import s from './register.module.css'
import '../App.css'
import { useState } from 'react'
import { useRef } from 'react'
function Register() {
  let [username, setUsername] = useState()
  let [email, setEmail] = useState()
  let [firstname, setFirstname] = useState()
  let [lastname, setLastname] = useState()
  let [password, setPassword] = useState()
  let [cpassword, setCpassword] = useState()
  let [usertype, setUsertype] = useState()

  let msg = useRef()
//-----
  console.log(username);
  console.log(email);
  console.log(firstname);
  console.log(lastname);
  console.log(password);
  console.log(cpassword);
  console.log(usertype);
//-----
const handleSubmit = (e) =>{
  e.preventDefault()
  if(username === "" | email === "" | firstname === "" | lastname === "" | password === "" | cpassword === "" | usertype === ""){
    msg.current.innerHTML = "Fill all the details!"
  }
}
  return (
    <div className='register'>
      <span className='heading'>Enter the Details</span>
      <form action="" className='rLoginBox'>
        <input type="text" name='userName' placeholder='Enter Username'
          onChange={(e) => {
            setUsername(e.target.value)
          }} />
        <input type="email" name='email' placeholder='Enter Email'
          onChange={(e) => {
            setEmail(e.target.value)
          }} />
        <input type="text" name='firstName' placeholder='Enter First Name'
          onChange={(e) => {
            setFirstname(e.target.value)
          }} />
        <input type="text" name='lastName' placeholder='Enter Last Name'
          onChange={(e) => {
            setLastname(e.target.value)
          }} />
        <input type="password" name='password' placeholder='Password'
          onChange={(e) => {
            setPassword(e.target.value)
          }} />
        <input type="password" name='confirmPassword' placeholder='Confirm Password'
          onChange={(e) => {
            setCpassword(e.target.value)
          }} />
        <div className='selectUserType'>
          <span className='subHeading'>Admin: <input type="radio" name='selectAU' value='admin'
            onChange={(e) => {
              setUsertype(e.target.value)
            }} /></span>
          <span className='subHeading'>User: <input type="radio" name='selectAU' value='user'
            onChange={(e) => {
              setUsertype(e.target.value)
            }} /></span>
        </div>
        <input type="submit" id='regbtn' value='Register' className='btn' onClick={(e)=>{handleSubmit(e)}} />
        <div className='msg' ref={msg}>
          
        </div>
      </form>
    </div>
  )
}

export default Register
